import React from 'react';

function AboutPage() {
  return (
    <div className="container">
      <h1>About Me</h1>
      <p>
        Hi! I'm a hacker and tech enthusiast passionate about cybersecurity, ethical hacking, and software development.
      </p>
    </div>
  );
}

export default AboutPage;
